import React, { Component } from "react";

class Hero extends Component {
  render() {
    return (
      <img
        src="../assets/book-cover-photo.jpg"
        className="img-fluid hero-img"
        alt="Shelves of Books"
      />
    );
  }
}

export default Hero;
